import {
  type AuthUser,
  type AuthVariables,
  checkPermissions,
  MOCK_USERS,
} from "./auth-types"

/**
 * 認証ミドルウェア
 *
 * TODO: Auth0統合時の実装手順
 * 1. jwtDecodeのコメントアウトを解除
 * 2. Auth0のJWTトークンを検証
 * 3. カスタムクレームからユーザー情報を取得
 * 4. prismaでユーザー情報を取得・検証
 */
export const authMiddleware = createMiddleware<{
  Variables: AuthVariables
}>(async (c, next) => {
  // 開発環境用：ヘッダーでモックユーザーを指定
  const mockUserId = c.req.header("X-Mock-User-Id")

  // TODO: 本番環境ではAuth0のトークンを使用
  const token = c.req.header("Authorization")?.replace("Bearer ", "")
  if (!token && !mockUserId) {
    console.log(`[Auth0 Auth] No token or mock user id`)
    return c.json({ error: "認証が必要です" }, 401)
  }

  try {
    let user: AuthUser

    if (mockUserId && process.env.NODE_ENV !== "production") {
      // 開発環境：モックユーザーを使用
      // @ts-expect-error
      user = MOCK_USERS[mockUserId]
      if (!user) {
        return c.json(
          { error: `モックユーザー ${mockUserId} が見つかりません` },
          401,
        )
      }
      console.log(`[Mock Auth] Using mock user: ${user.name} (${user.role})`)
    } else {
      // 本番環境：Auth0のJWTを検証（DB参照なしの最小実装）
      console.log(`[Auth0 Auth] Using token: ${token}`)
      if (!token) {
        return c.json({ error: "トークンが見つかりません" }, 401)
      }

      const issuer = process.env.AUTH0_ISSUER_BASE_URL // 例: https://<tenant>.auth0.com/
      const audience = process.env.AUTH0_AUDIENCE // 例: https://api.local.example
      if (!issuer || !audience) {
        return c.json(
          {
            error:
              "サーバ環境変数が未設定です(AUTH0_ISSUER_BASE_URL / AUTH0_AUDIENCE)",
          },
          500,
        )
      }

      const JWKS = createRemoteJWKSet(new URL(`${issuer}.well-known/jwks.json`))
      const { payload } = await jwtVerify(token, JWKS, {
        issuer,
        audience,
        algorithms: ["RS256"],
        clockTolerance: 5,
      })

      // まずは通すだけ：JWTのsub等を元に最小限のユーザー情報を設定
      const sub = (payload.sub as string) ?? "unknown"
      user = {
        userId: sub,
        name: (payload["name"] as string) ?? "",
        role: "user",
        headquarterId: "", // 必要なら別ミドルウェアで設定
        accessibleStoreIds: [], // 必要なら別ミドルウェアで設定
      }
    }

    // コンテキストに認証情報を設定
    c.set("user", user)
    c.set("headquarterId", user.headquarterId)
    c.set("storeIds", user.accessibleStoreIds)

    return await next()
  } catch (error) {
    console.error("Authorization error:", error)
    return c.json({ error: "認証エラーが発生しました" }, 401)
  }
})

/**
 * 本部ユーザーのみ許可するミドルウェア
