}>(async (c, next) => {
  const user = c.get("user")
  const permissions = checkPermissions(user)

  if (!permissions.isHqStaff) {
    throw HTTPException(
      EXCEPTION_TYPE.FORBIDDEN,
      "本部ユーザーのみアクセス可能です",
    )
  }

  return await next()
})

