// ユーザーロールの定義
export const USER_ROLE = {
  /** 本部スタッフ：全店舗の全機能にアクセス可能 */
  HQ_STAFF: "HQ_STAFF",
  /** 店舗スタッフ：自店舗の全機能にアクセス可能 */
  STORE_STAFF: "STORE_STAFF",
} as const

export type UserRole = (typeof USER_ROLE)[keyof typeof USER_ROLE]

// 認証済みユーザー情報
export type AuthUser = {
  /** ユーザーID（将来的にはAuth0のsub） */
  userId: string
  /** ユーザーのロール */
  role: UserRole
  /** 所属する本部ID */
  headquarterId: string
  /** 所属する店舗ID（店舗スタッフの場合） */
  storeId?: string
  /** アクセス可能な店舗IDリスト */
  accessibleStoreIds: string[]
  /** メールアドレス */
  email: string
  /** 名前 */
  name: string
}

// Honoコンテキストに設定する変数の型定義
export type AuthVariables = {
  /** 認証済みユーザー情報 */
  user: AuthUser
  /** 所属する本部ID（ショートカット） */
  headquarterId: string
  /** アクセス可能な店舗IDリスト（ショートカット） */
  storeIds: string[]
}

// 権限チェック用のヘルパー型
export type PermissionCheck = {
  /** 本部スタッフかどうか */
  isHqStaff: boolean
  /** 店舗スタッフかどうか */
  isStoreStaff: boolean
}

// 権限チェック用のユーティリティ関数
export function checkPermissions(user: AuthUser): PermissionCheck {
  const isHqStaff = user.role === USER_ROLE.HQ_STAFF
  const isStoreStaff = user.role === USER_ROLE.STORE_STAFF

  return {
    isHqStaff,
    isStoreStaff,
  }
}

